import logo from './logo.svg';
import './App.css';
import { useEffect, useState } from 'react';
import { FaInstagram, FaYoutube, FaTwitter, FaGithub, FaWhatsapp } from 'react-icons/fa';

function App() {
  const [bgColor, setBgColor] = useState("#a8a2a2ff");
  const [fontColor,setFontcolor]=useState('#223633ff');
  const [headBarLength,setHeadBarLemgth]=useState("0px")

  useEffect(() => {
    const handleMouseMove = () => {
      setHeadBarLemgth(String(window.scrollY )+'px')
      console.log("values",headBarLength)
      if (window.scrollY > 300) {

        setBgColor('#050e0cff');
        setFontcolor('#0c7a57ff');
      } else {
        setBgColor("#d1d1d1ff");
        setFontcolor('black')
      }
    }
    window.addEventListener("scroll", handleMouseMove);

    return () => window.removeEventListener("scroll", handleMouseMove);
  });




  return (<div style={{ background: bgColor, transition: 'background 2s ease' ,color:fontColor }} >

    <nav style={{background:'red' ,position:'fixed',background: "rgba(255, 255, 255, 0.2)", backdropFilter: "blur(2px)"}} >
      <div style={{ borderTop: "4px solid ", width: headBarLength ,transition: "border-color 4s ease"}} ></div>
    </nav>
    <nav className='nav-bar' style={{
      background: "rgba(255, 255, 255, 0.2)", backdropFilter: "blur(2px)",
      display: 'flex', position: 'fixed', width: '100%',marginTop:'4px'
    }}>

      <img style={{ width: '50px', height: '50px', borderRadius: '50%', margin: '10px' }} src="/MyPic.jpeg" alt="Profile" />
      <div style={{ marginLeft: 'auto' }} >
        <button style={{ width: '150px', height: '30px', margin: '10px', cursor: 'none' }} >Curriculum Vitae | CV</button>
        <button style={{ width: '50px', height: '50px', position: 'relative', margin: '20px', borderRadius: '30%' }}>
          <div style={{ textAlign: 'center', marginTop: '0px' }}><h1>☰</h1></div></button></div>
    </nav>


    <div style={{ display: 'flex', gap: '50px' }}>

      <div>
        <nav style={{
          display: 'flex', flexDirection: 'column', gap: '10px', marginLeft: '20px'
          , marginBottom: 'auto', justifyContent: 'flex-end', height: '100vh',
          position: 'fixed'
        }}>
          <FaInstagram size={24} color={fontColor} />
          <FaYoutube size={24} color={fontColor} />
          <FaTwitter size={24} color={fontColor} />
          <FaGithub size={24} color={fontColor}  />
          <FaWhatsapp size={24} color="#E1306C" />
          <div style={{ borderLeft: "2px solid black", height: "150px", position: 'relative', left: '11px' }}></div>
        </nav>
      </div>
      <div>



        <div id='Home' style={{ margin: '30px', marginTop: '145px', padding: '20px' }}>
          <h1 style={{ fontSize: '42px', fontWeight: '700px', margin: 0, lineHeight: 1.2 }}>Good day,</h1>
          <h1 style={{ fontSize: '42px', margin: 0, lineHeight: 1.2 }}>I am Durga Prasad,</h1>
          <h2 style={{ fontSize: '28px', color: 'blue', margin: 0, lineHeight: 1.2 }} >A Python Developer</h2>
          <p>I’m a skilled mobile app developer with over 4 years of experiencein the IT industry. <br /> Using React Native, I create full-stack mobile apps that cater to the needs of diverse clients. My expertise lies in developing hybrid apps for both Android and iOS platforms, ensuring that users have access to efficient and user-friendly applications. <br /> With a deep understanding of the mobile app development process, I am able to deliver high-quality results that exceed expectations. <br /> If you’re looking for a reliable mobile app developer to bring your ideas to life, I’m here to help!</p>
          <button style={{ width: '100px', height: '40px', cursor: 'pointer' }}> Contact me</button>
        </div>


        <div id='MyPortFolio' style={{ margin: '90px', marginTop: '145px' }}>

          <h1 >My Portfolio</h1><div style={{ borderTop: "2px solid black", width: '400px'}} ></div><br />
          <div style={{ display: 'flex' }}>
            <div>
              <p1>Greetings, I'm Muhammad Aamir Malik, a seasoned mobile app developer with over 3 years of experience in the dynamic IT industry. My expertise lies in crafting cutting-edge, full-stack mobile and hybrid applications for Android and iOS platforms, utilizing the power of React Native. I take immense pride in my work, striving to develop applications that are not only efficient but also user-friendly, catering to the diverse needs of clients globally.</p1>
              <br /><br /><p1>Having successfully delivered projects to satisfied clients worldwide, I've gained valuable experience collaborating with individuals from various cultures. My journey has taken me from local software houses to platforms like Fiverr and Upwork, eventually leading me to work with international companies. This diverse exposure has enriched my understanding of different perspectives and enhanced my ability to adapt to varied work environments.</p1>
               <ul style={{display:'flex' ,gap:'30px'}}>
                  <li>JavaScript</li>
                  <li>React </li>
                   <li>Django</li>
                    <li>Mysql</li>

               </ul>
            </div>

            <div>
              <img style={{ width: '350px', height: '350px', borderRadius: '10%', margin: '10px' }} src='/MyPic.jpeg' alt='profile Pic' />
            </div></div>

            <div id='experience' style={{marginLeft:'250px',marginTop:'150px'}}>
            <h1>My Word experience</h1>
            <div style={{ borderTop: "2px solid black", width: '400px'}} ></div>
            <div style={{display:'flex'}}>
             <nav style={{
          display: 'flex', flexDirection: 'column', gap: '1px', marginLeft: '20px',position:'relative' }}>

             <h1>hai</h1>
              <h1>hai</h1>
               <h1>hai</h1> </nav>
            </div>
            </div>
        </div>



      </div>

      <div style={{ marginLeft: 'auto', justifyContent: 'flex-end' }}>
        <nav style={{
          display: 'flex', flexDirection: 'column', gap: '10px', right: '1px',
          position: 'fixed', marginBottom: 'auto', justifyContent: 'flex-end', height: '100vh'
        }}>
          <h1 style={{ writingMode: 'vertical-rl', fontSize: '15px',margin: 0, lineHeight: 1.2 ,position: 'relative',right:'17px'}}>saisankula369@gmail.com</h1>
          <div style={{ borderLeft: "2px solid black", height: "115px", position: 'relative', right: '11px' }}></div>

        </nav>
      </div>
    </div>


  </div>);
}

export default App;
